Key = "adasd"

Secret = "adsasdfdf"


client=Client(api_key=Key, api_secret=Secret)
'''get a full list fo all Coins as list[]'''
def coin_list():
    coins = client.get_coin_list()
    coinlist=[]
    for m in coins:
        coinlist.append(m['coin'])
    return coinlist


'''get markets (only BTC) in e.g. "QLC-BTC" as list[]'''
def list_markets():
    markets=client.get_trading_symbols('BTC')
    marketlist=[]
    for m in markets:
        marketlist.append(m['symbol'])
    return marketlist

