'''getting klines 30min resolution'''
def get_klines():
    #trace=test_market_list
    trace=list_markets()
    dct={}
    for n in trace:
        print(n)
        klines=client.get_historical_klines_tv(n, Client.RESOLUTION_30MINUTES, "20 Jan, 2018", "26 Jan, 2018")
        #klines = client.get_historical_klines_tv(n, Client.RESOLUTION_5MINUTES, "1 hour ago UTC")
        #klines = client.get_historical_klines_tv(n, Client.RESOLUTION_15MINUTES, "18 Jan, 2018", "20 Jan, 2018")
        dct[n]=klines
        time.sleep(.3)
    return dct

