'''#old data and new data merge from klines.get_historical for single markets'''
def merge_klines(klines1,klines2):
    klines1map={}
    for kline in klines1:
        klines1map[kline[0]] = kline
    klines2map={}
    for kline in klines2:
        klines2map[kline[0]] = kline
    klines1map.update(klines2map)
    klines = list(klines1map.values())
    klines = sorted(klines)
    x = klines[0][0]
    y = klines[1][0]-klines[0][0]
    for time in klines:
        if time[0] == x:
            x = time[0] + y
        else:
            raise ValueError('Klines Time Error:'+str(x))
